import React, { useState } from 'react';
import { Button, Modal } from 'antd';

export default function GenerateAllEscalas({ usr, selectedPatient }) {

    const [isModalOpen, setIsModalOpen] = useState(false);
    const showModal = () => {
        setIsModalOpen(true);
    };
    const handleOk = () => {
        setIsModalOpen(false);
    };
    const handleCancel = () => {
        setIsModalOpen(false);
    };

    let l = `https://sistema.recreamed.com/gad_7_public/${usr}/${selectedPatient}/${Date.now()}/depreres/inicial`
    let l2 = `https://sistema.recreamed.com/gad_7_public/${usr}/${selectedPatient}/${Date.now()}/depreres/final`

    return (
        <div>
            <Button type="primary" onClick={showModal}>
                Generar escalas
            </Button>
            <Modal title="Nuevas escalas" open={isModalOpen} onOk={handleOk} onCancel={handleCancel}>
                <span>{l}</span> <br />
                <span>{l2}</span>
            </Modal>
        </div>
    )
}
